import{_ as o}from"./chunks/index.VAya1KE4.js";import{c,o as a,G as e,k as t}from"./chunks/framework.BFEalnvt.js";import"./chunks/theme.B1I7hsVa.js";import"./chunks/getArrayRandomItem.LhrzGfRF.js";const l=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"params":{"pkg":485,"idList":[1158,1109,996,997,950,916,840,801,759,680,634,317,65,378,73,316,318,150,758,493,485,80,371,158,227,379,179,147],"data":{"id":485,"name":"派派","summary":"派派·韦尔","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/07/01/76099754/90668b1414a002827f47c02feccbdf3e_8975374000446600175.png","avatar":{"m":"https://act-upload.mihoyo.com/nap-obc-indep/2024/12/30/76099754/2fb0f961dc0c64c00fa8fdb4d679dff0_8506829881943612949.png","pc":"https://act-upload.mihoyo.com/nap-obc-indep/2024/07/01/82500917/102594259ff0844c16286931f27e3738_7546128660858702351.png"},"attrs":[["稀有度","A"],["属性","物理"],["特性","异常"],["阵营","卡吕冬之子"]],"destiny":[["LEVEL1悠闲一刻","派派在[特殊技：轮胎转]、[强化特殊技：引擎转]或[终结技]中发动旋转斩击命中敌人时，有50%概率额外获得1层[动力]，[动力]的叠加层数上限提升至30层。卡吕冬之子某个平常的上午，派派慢悠悠地打了个哈欠。「早上好——」「今天也能悠闲地度过吧？养生可是很重要的，不然这个人会过劳死哦——」"],["LEVEL2上进心","在[特殊技：轮胎转]和[强化特殊技：引擎转]发动期间，派派的移动速度有所提升；在[特殊技：有亿点重]、[强化特殊技：非常重]和[终结技]中发动下砸攻击命中敌人时，招式造成的物理伤害提升10%，每拥有1层[动力]，该增益效果额外提升1%。暂时的努力，是为了更加长久的休憩。当然，如果能一直都不努力就更好了——派派伸了个懒腰，拍了拍卡车里的柔软床铺，躺了下来。"],["LEVEL3卡车专家","[普通攻击]、[闪避]、[支援技]、[特殊技]、[连携技]技能等级+2派派总是对卡车的一切充满兴趣。即使是在熟睡的状态下，只要引擎声响起，少女就能瞬间清醒：「100马力，载重5吨，这是…三门重工新发售的轻型卡车！」"],["LEVEL4技巧娴熟","队伍中任意角色对敌人施加属性异常效果时，派派回复20点能量，30秒内最多触发一次。成为派派的乘客是一件让人心惊胆战的事。通常在她慢悠悠地提醒「坐～稳～咯～」的时候，「稳」字发音还没结束，卡车就已经向前行驶了惊人的距离。当然，她总能在最短的时间内把你安全送到目的地——精神损失不算在内。"],["LEVEL5私人爱好","[普通攻击]、[闪避]、[支援技]、[特殊技]、[连携技]技能等级+2派派似乎拥有一些不太符合外表的私人爱好。「这匹马好像很能跑的样子…唔，但是买的人好少，果然还是那匹胜率更高吗…」「嗝——燃油饮…我才没喝多…再来一杯！」"],["LEVEL6轻度兴奋","[强化特殊技：引擎转]的持续时间上限提升2秒，[动力]的持续时间提升4秒。如你所知，派派最大的愿望是永远都能悠闲度日。但此刻，少女总是半睁着的双眸竟少有的精神奕奕。「如果是为了你…这个人稍微努力一下下，也可以哦～」"]],"skill":[{"title":"普通攻击：准备发车","desc":"点按发动：向前方进行至多四段的斩击，造成物理伤害；","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/06/30/82500917/cd7008274d005a14e1831a1f19e58a6a_5776055973379785170.gif"},{"title":"闪避：手刹漂移","desc":"点按发动：快速的冲刺闪避；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/23/82500917/dee033942a7f60021311555f66da14b1_4962518125830096468.gif"},{"title":"冲刺攻击：一脚油门","desc":"闪避时，点按发动：向前方进行斩击，造成物理伤害。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/23/82500917/43e911bd0b8cf92efd33d4dd625f19f2_2540327572265361273.gif"},{"title":"闪避反击：动力漂移","desc":"触发[极限闪避]后，点按发动：对前方敌人发动下砸攻击，造成物理伤害；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/23/82500917/0b7b7e99cd707068b9b8ccd32c5b1ea9_7724535864291881019.gif"},{"title":"快速支援：点刹","desc":"当前操作中的角色被击飞时，点按发动：对前方敌人发动下砸攻击，造成物理伤害；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/23/82500917/4821f01216fc4622c3075024cb071516_6957069922773579792.gif"},{"title":"招架支援：极限刹车","desc":"前场角色即将被攻击时，点按发动：招架敌人的攻击，累积大量失衡值；具有较为优秀的招架性能，承受高强度攻击时[支援点数]的消耗量降低；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/23/82500917/b1d1e29a9d2f68f701662bb679bc3954_203382510594966232.gif"},{"title":"支援突击：弯道超车","desc":"发动[招架支援]后，点按发动：对前方敌人发动突进斩击，造成物理伤害；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/23/82500917/ba0b2b6e9f20cb2576f576b5e8264303_7661416749785179734.gif"},{"title":"特殊技：轮胎转","desc":"点按发动：转动身体向周围发动旋转斩击，造成物理伤害；长按可以延长招式的持续时间，发动越来越强的旋转斩击，并提升招式的蓄力等级，最多提升2次；若衔接在[普通攻击]前三段、[冲刺攻击]或[闪避反击]之后，则能够以提升后的蓄力等级快速发动[特殊技：轮胎转]；招式发动期间抗打断等级提升，受到的伤害降低40%。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/23/82500917/bf07810366a975b2469fe2138b5ac73d_788028653615681139.gif"},{"title":"特殊技：有亿点重","desc":"在[特殊技：轮胎转]发动期间，松开发动：根据[特殊技：轮胎转]的蓄力等级，向前方发动下砸攻击，造成物理伤害；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/23/82500917/35f3f6b3552df3930ef34b0cef9bd55b_1558038600639316878.gif"},{"title":"强化特殊技：引擎转","desc":"能量足够时，在[特殊技：轮胎转]达到最高蓄力等级后，继续长按发动：快速转动身体，向周围发动旋转斩击，造成大量物理伤害；发动期间持续消耗能量，最多持续3秒；招式发动期间抗打断等级提升，受到的伤害降低40%。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/23/82500917/91ebfe2184736c46617e56a58d067f4d_872637810723025559.gif"},{"title":"强化特殊技：非常重","desc":"在[强化特殊技：引擎转]发动期间，松按发动：向前方发动强力的下砸攻击，造成大量物理伤害；在[强化特殊技：引擎转]发动期间，持续时间达到上限或能量降低至20点时，将会自动发动[强化特殊技：非常重]；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/23/82500917/1e2f716124d1f24e4a2c8a8daee9d891_6526407235492232665.gif"},{"title":"连携技：系好安全带","desc":"触发[连携技]时，选择对应角色发动：对前方敌人发动强力下砸攻击，造成大量物理伤害；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/23/82500917/0a5f1a76b1de4f772419add852180c17_3913900828314766112.gif"},{"title":"终结技：坐～稳～啦～ ","desc":"喧响等级达到[极]时，点按发动：快速转动身体，对前方大范围敌人发动强力的旋转斩击，随后发动下砸攻击，造成大量物理伤害；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/23/82500917/2632d7fe79382ba2cacda3c0454d317f_583060959304105332.gif"},{"title":"核心技","desc":"核心被动：动力蓄能派派在[强化特殊技：引擎转]或[终结技]中发动旋转斩击命中敌人时，获得1层[动力]，最多叠加20层，持续12秒，重复触发时刷新持续时间；每拥有一层[动力]，派派的物理异常积蓄效率提升2%。（此处数据为初始数据）额外能力：同步疾驰队伍中存在与自身属性或阵营相同的角色时触发：派派拥有20层或以上[动力]时，全队造成的伤害提升18%。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/07/01/82500917/c737e1d1a4db14ad435c7df98125599b_4041291001700768735.gif"}]},"favModalLocalKey":"vitepress_game_zzz_role_fav_modal","favLocalKey":"vitepress_game_zzz_role_fav"},"relativePath":"game/zzz/role/485.md","filePath":"game/zzz/role/[pkg].md"}'),d={name:"game/zzz/role/485.md"},_=Object.assign(d,{setup(i){return(p,n)=>(a(),c("div",null,[e(t(o))]))}});export{l as __pageData,_ as default};
